import './App.css';
import React, { useState } from "react";
import { Grid, Button, Drawer, List, ListItem, Typography, IconButton } from "@material-ui/core";
import MenuIcon from "@material-ui/icons/Menu";
import ChevronLeftIcon from "@material-ui/icons/ChevronLeft";
import '@fontsource/roboto';
import lybLogo from "./lybLogo2.png";


function App() {

  const [openNav, setOpenNav] = useState(false);
  const [pageSelect, setPageSelect] = useState("home")

  const openDrawer = (e) => {
    e.preventDefault();
    setOpenNav(!openNav);
    console.log(openNav);
  }

  const openPage = (e, page) => {
    e.preventDefault();
    setPageSelect(page);
    setOpenNav(false)
    console.log(page);
  }

  const page = ["Contact", "About", "Prenatal", "Labor and Birth", "Newborn"]

  return (
    <div className="App">
      <Grid container style={{ paddingTop: "8%" }}>
        <Grid md="1" xs="1">
          <IconButton onClick={openDrawer}>
              <MenuIcon />
          </IconButton>
        </Grid>

        <Grid md="10" xs="10">
          <img src={lybLogo} style={{ width: "60%", height: "auto", paddingLeft: "8%", paddingRight: "8%" }}/>
        </Grid>

        <Grid md="1" xs="1">

        </Grid>
      </Grid>


      <Drawer anchor="left" open={openNav} syle={{ paddingTop: "8%" }}>
        <List>
          <IconButton onClick={openDrawer}>
              <ChevronLeftIcon/>
          </IconButton>
          {page.map((item) => (
            <ListItem> 
              <Button onClick={e => openPage(e, item)}>{item}</Button>
            </ListItem>
          ))}
          <Button >Exit</Button>
        </List>
      </Drawer>
    </div>
  );
}

export default App;
